import { Outlet, Route, Routes } from "react-router-dom"
import { BookingForm } from "../booking/BookingForm"
import { Requests } from "../booking/Requests"

import "./ApplicationViews.css"

export const StaffViews = () => {

    // const localFatBackUser = localStorage.getItem("fatback_user")
    // const fatbackUserObject = JSON.parse(localFatBackUser)

    return (
        <Routes>

            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/" element={
                <div className="views">
                    <h1 className="title-main">FatBack Studio</h1>


                    <Outlet />
                </div>
            }>

                <Route path="booking" element={<BookingForm />} />
                <Route path="booking/requests" element={<Requests />} />

            </Route>
        </Routes>
    )
}
